-- Update Memory/RAM
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
where PRD_NAME LIKE '%RAM%' OR PRD_NAME LIKE '%MEMORY%' OR PRD_NAME LIKE '%DDR%';

-- Update hard drive
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%HDD%' OR PRD_NAME LIKE '%HARD DRIVE%' OR PRD_NAME LIKE '%HARD DISK DRIVE%';

-- Update SSD
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
WHERE PRD_NAME LIKE '%SSD%' OR PRD_NAME LIKE '%SOLID STATE%';

-- Update processor
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
WHERE PRD_NAME LIKE '%PROCESSOR%' OR PRD_NAME LIKE '%CPU%'OR PRD_NAME LIKE '%INTEL%';

-- Update dvd rom
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%DVD%';

-- Update mouse
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%MOUSE%';

-- Update keyboard
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%KEYBOARD%';

-- Update GPU
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%GPU%' or PRD_NAME LIKE '%RADEON%';

-- Update speakers
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%SPEAKERS%';

-- Update headset
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_NAME LIKE '%HEADSET%';

-- Update workstation
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x''
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'DH%' AND (PRD_NAME LIKE '%POWER%' or PRD_NAME LIKE '%I7%' OR PRD_NAME LIKE '%I5%' or PRD_NAME LIKE '%DUAL CORE%');

UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x''
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'DH%' AND (PRD_NAME not LIKE '%POWER%' and PRD_NAME not LIKE '%I7%' and PRD_NAME not LIKE '%I5%' AND PRD_NAME NOT LIKE '%DUAL CORE%');

UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'DHPO%' OR (PRD_NAME LIKE '%3040 MT%' OR PRD_NAME  LIKE '%800G2%');


-- Update Laptops
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'LH%'; 

UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'LH%' AND (PRD_NAME LIKE '%E5570 - i5-6300U%' OR PRD_NAME LIKE '%640%'); 


UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'LH%'AND (PRD_NAME LIKE '%BNBPC' OR PRD_NAME LIKE '%Z15%'); ; 

-- Update Monitors
UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'DMMO';

UPDATE calordersdb.PRODUCT SET `PRD_IMG_IMAGE` = x'' 
,`PRD_IMG_TYPE_CD` = 'PNG'
WHERE PRD_CATEGORY_CD like 'DMMO' AND (PRD_NAME LIKE '%P2213%' OR PRD_NAME LIKE '%E202%');

